import Header from "./components/Header";
import withDashboardContext from "./hoc/withDashboardContext";
import "./ActiveStudents.css";
import { Link, useNavigate } from "react-router-dom";

const ActiveStudents = () => {
  return (
    <div>
      <Header />
      <div
        style={{
          background: "rgb(204,204,204,.5)",
          height: "100vh",
        }}
      >
        <div
          style={{
            height: "fit-content",
            width: "70%",
            margin: "0 auto",
            paddingTop: "1rem",
          }}
        >
          <div
            style={{
              display: "flex",
              justifyContent: "space-between",
              alignItems: "center",
            }}
          >
            <button
              className="backButton"
              style={{
                borderRadius: "2px",
                padding: ".5rem 1rem",
                background: "#dc4d01",
              }}
              onClick={() => {
              }}
            >
              Back
            </button>
            <span style={{ fontSize: ".9rem" }}>
              <Link
                to={"/dashboard"}
                style={{
                  color: "black",
                  textDecoration: "none",
                  cursor: "pointer",
                }}
              >
                Home {">"}
              </Link>
              <span style={{ color: "grey" }}> All Active Users</span>
            </span>
          </div>
          <div
            style={{
              background: "white",
              padding: "1rem 1rem 2rem",
              borderTop: "3px solid blue",
              marginTop: "1rem",
            }}
          >
            <span>All Active Users</span>
            <table>
              <tr>
                <th>Action</th>
                <th>Name</th>
                <th>Email</th>
                <th>Access Code</th>
                <th>Registration Date</th>
                <th>Status</th>
              </tr>
              <tr>
                <td>Test</td>
                <td>Test</td>
                <td>Test</td>
                <td>Test</td>
                <td>Test</td>
                <td>Test</td>
              </tr>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default withDashboardContext(ActiveStudents);
